import React from 'react'

const NavigationLogo = (props) =>{
    return(
        <div className="flex justify-evenly items-center mx-4 my-2">
            <img src='/images/logo_noodles.png' alt = 'noodles' className = 'h-14 w-14 pr-2'/>
            <div className = "text-black pl-2 text-4xl font-artistic tracking-widest">
                Pasterino
            </div>
        </div>
    );
}

export default NavigationLogo;
